import React from "react";
import { MapList } from "@semapps/geo-components";
import {
  useGetMany,
  useGetOne,
  ResourceContextProvider,
  List,
} from "react-admin";

const Map = () => {
  const { ids, data, basePath } = useGetList("Place", {
    page: 1,
    perPage: 1000,
  });
  const listContext = useList({
    data,
    ids,
    basePath: "/resource",
    resource: "resource",
  });
  // const { data } = useGetList("Place");

  console.log({ ids, data, basePath });
  // console.log(data);
  return (
    <ResourceContextProvider value="Place">
      <List syncWithLocation basePath="/Place">
        <MapList
          {...{ ids, data, basePath }}
          record={data}
          latitude={(record) => {
            console.log(record);
            return record?.["pair:hasPostalAddress"]?.["pair:latitude"];
          }}
          longitude={(record) =>
            record?.["pair:hasPostalAddress"]?.["pair:longitude"]
          }
          label={(record) => record?.["pair:label"]}
          description={(record) =>
            record?.["pair:hasPostalAddress"]?.["pair:label"]
          }
          scrollWheelZoom
        />
      </List>
    </ResourceContextProvider>
  );
};
export default Map;
